  [],\n\t\"revision_timestamp\": \"2016-10-15T16:34:11.343429\",\n\t\"name\": \"narrative-report-bombay-hook-national-wildlife-refuge-may-august-1961\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bombay Hook NWR
  outlines Refuge accomplishments from May through August of 1961. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, fish,
  and reptiles- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, collections and receipts, and vegetation control.
  Resource management is outlined; topics include haying and commercial fishing. A
  progress report on field investigations and applied research is also provided. The
  public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, and safety. N-R forms, photographs, and newspaper articles
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
